def comb_sort(nums):
    """Sorts a list of elements using the combination sort algorithm.

    Args:
        nums: A list of elements to be sorted.
    """
    n = len(nums)
    gap = n // 2  # Initial gap

    for i in range(n):
        for j in range(0, gap, 2):
            if i != j:
                temp = nums[i]
                nums[i] = nums[j]
                nums[j] = temp

                for k in range(j + 1, gap):
                    if nums[k] > temp:
                        nums[k] = temp
                gap = j - i + 1  # Update gap
    return nums
```

