def extract_missing(test_list, strt_val, stop_val):
    """
    Extracts the ranges that are missing from the given list with the given start range and end range values.

    Args:
        test_list (list): The list of numbers.
        strt_val (int): The start of the range.
        stop_val (int): The end of the range.

    Returns:
        list: A list of ranges that are missing from the given list.
    """
    missing_ranges = []
    if not test_list:
        return missing_ranges

    start_uncovered = -1
    for i, num in enumerate(test_list):
        if num < strt_val:
            start_uncovered = i
        else:
            break

    if start_uncovered == -1:
        return []

    end_uncovered = stop_val
    if end_uncovered < strt_val:
        end_uncovered = stop_val + 1

    for i in range(start_uncovered, end_uncovered):
        if i not in test_list:
            missing_ranges.append((i, i + 1))

    return missing_ranges
```

