def extract_missing(test_list, strt_val, stop_val):
    """
    Extracts the ranges that are missing from the given list with the given start range and end range values.

    Args:
        test_list (list): The list of numbers.
        strt_val (int): The start of the range.
        stop_val (int): The end of the range.

    Returns:
        list: A list of missing ranges.
    """
    missing_ranges = []
    if not test_list:
        return missing_ranges

    start_uncovered = -1
    end_uncovered = -1

    for i, num in enumerate(test_list):
        if num < strt_val:
            start_uncovered = i
        else:
            end_uncovered = i

    if start_uncovered == -1:
        for i in range(len(test_list) - 1):
            if test_list[i+1] - test_list[i] > strt_val - stop_val:
                start_uncovered = i + 1
                break
    if end_uncovered == -1:
        for i in range(len(test_list) - 1, 0, -1):
            if test_list[i] - test_list[i-1] > strt_val - stop_val:
                end_uncovered = i - 1
                break

    if start_uncovered != -1 and end_uncovered != -1:
        missing_ranges.append((start_uncovered, end_uncovered))

    return missing_ranges
