def magic_square_test(my_matrix):
    """
    Checks if a given 2x2 matrix is a magic square.

    Args:
        my_matrix: A list of lists representing the 2x2 matrix.

    Returns:
        True if the matrix is a magic square, False otherwise.
    """
    n = len(my_matrix)
    if n != 2:
        return False

    if n == 1:
        return True

    magic_sum = sum(my_matrix[0])

    for i in range(n):
        if sum(my_matrix[i]) != magic_sum:
            return False

    for j in range(n):
        if sum(my_matrix[j]) != magic_sum:
            return False

    return True
```

