        while(b):
            a, b = b, a % b
        return a

    def lcm(a, b):
        return (a * b) // gcd(a, b)

    for i in range(1, R + 1):
        for j in range(i + 1, R + 1):
            if lcm(i, j) >= L and lcm(i, j) <= R:
                return (i, j)

    return None
