def maximize_elements(test_tup1, test_tup2) -> tuple:
    """
    Given two tuples, return the tuple with the maximum sum of elements.
    For example:
    maximize_elements((1, 2, 3), (4, 5, 6)) == (6, 5, 4)
    maximize_elements((1, 2), (3, 4)) == (4, 3)
    maximize_elements((1, 2, 3), (1, 2)) == (3, 2)
    """
    if len(test_tup1) < 2 or len(test_tup2) < 2:
        return (test_tup1, test_tup2)

    tup1 = sorted(test_tup1)
    tup2 = sorted(test_tup2)

    max_sum = sum(tup1) + sum(tup2)

    if max_sum > sum(tup1) + sum(tup2):
        return (max_sum, tup2[0], tup1[-1])
    else:
        return (sum(tup1), tup1[-1], max_sum)
