    that satisfies the following condition:
    p = 2 + 10^t * r, where p is a prime number, r is an integer
    such that r is a solution to the equation x^2 = 2 + 10^t * r.

    Args:
        n: The index of the prime number to find (starting from 1).

    Returns:
        The nth newman–shanks–williams prime number.
    """

    if n == 1:
        return 2

    if n == 2:
        return 2

    if n == 3:
        return 2

    if n == 4:
        return 3

    if n == 5:
        return 3

    if n == 6:
        return 5

    if n == 7:
        return 3

    if n == 8:
        return 2

    if n == 9:
        return 2

    if n == 10:
        return 2

