def division_elements(test_tup1, test_tup2):
    """
    Performs mathematical division of two tuples.

    Args:
        test_tup1: The first tuple of numbers.
        test_tup2: The second tuple of numbers.

    Returns:
        A tuple containing the result of the division and the remainder.
        Returns (None, None) if the input tuples are invalid.
    """
    if not isinstance(test_tup1, tuple) or not isinstance(test_tup2, tuple):
        return (None, None)
    if len(test_tup1) != len(test_tup2):
        return (None, None)

    result = tuple(test_tup1[i] / test_tup2[i] for i in range(len(test_tup1)))
    remainder = test_tup1[len(test_tup1) - 1] - test_tup2[len(test_tup1) - 1]
    return (result, remainder)
