def validate(n):
    """
    Checks whether the frequency of each digit is less than or equal to the digit itself.

    Args:
        n: An integer.

    Returns:
        True if the frequency of each digit is less than or equal to the digit itself,
        False otherwise.
    """
    freq = {}
    for digit in str(n):
        digit = int(digit)
        if digit in freq:
            freq[digit] += 1
        else:
            freq[digit] = 1
    for digit in freq:
        if freq[digit] > n:
            return False
    return True
