        """Checks if a sequence is a valid binary sequence."""
        for i in range(len(seq) - 1):
            if seq[i] != '0' and seq[i+1] != '1':
                return False
        return True

    def count_sequences(length, target_sum):
        """Counts the number of sequences of a given length with a specific sum."""
        if length == 0:
            return 1 if target_sum == 0 else 0

        if length == 1:
            return 2 if target_sum == 1 else 0

        count = 0
        for i in range(2**(length - 1)):
            binary_string = bin(i)[2:].zfill(length)
            current_sum = 0
            for j in range(length):
                current_sum += int(binary_string[j])

            if current_sum == target_sum:
                count += 1
        return count

    return count_sequences(2 * n, n)
