def large_product(nums1, nums2, N) -> list[int]:
    """
    Given two lists of integers, find the number of largest products from two given lists.
    For example:
    large_product([1, 2, 3], [4, 5, 6], 2) == 1
    large_product([1, 2, 3], [4, 5, 6], 3) == 1
    """
    product_map = {}
    for num in nums1:
        product_map[num] = num * num
    for num in nums2:
        product_map[num] = num * num
    max_products = []
    for product in product_map.values():
        if product > max_products[0]:
            max_products = [product]
        elif product == max_products[0]:
            max_products.append(product)
    return max_products
