def ctr_ele(el):
    """
    Reflects the modified run-length encoding from a list.

    Args:
      el: A list of integers representing the run-length encoded data.

    Returns:
      A list of integers representing the modified run-length encoded data.
    """
    if not el:
        return []

    result = []
    counts = {}
    for num in el:
        if num in counts:
            counts[num] += 1
        else:
            counts[num] = 1

    for num in el:
        result.append(num)
        if num in counts:
            counts[num] -= 1
            if counts[num] == 0:
                del counts[num]

    return result
```

