def smallest_missing(A, left_element, right_element) -> int:
    """
    Finds the smallest missing element in a sorted array.

    Args:
        A: A sorted array of integers.
        left_element: The left boundary of the range.
        right_element: The right boundary of the range.

    Returns:
        The smallest missing element in the array.
    """
    n = len(A)
    if left_element == 0:
        if right_element == n:
            return n
        else:
            return right_element - 1
    elif right_element == n:
        if left_element != n:
            return n
        else:
            return left_element
    else:
        return left_element
