def rearrange_bigger(n):
    """
    Creates the next bigger number by rearranging the digits of a given number.

    Args:
        n: The input number (integer).

    Returns:
        The rearranged number (integer).
    """
    digits = sorted(str(n))
    if digits[0] == '0':
        first_non_zero = 0
        for i in range(1, len(digits)):
            if digits[i] != '0':
                first_non_zero = digits[i]
                break
        if first_non_zero == 0:
            return '0'
        else:
            return int(str(first_non_zero) + digits[0] + '0')
    else:
        return int(str(digits[0]) + digits[1:])
