def rearrange_bigger(n):
    """
    Creates the next bigger number by rearranging the digits of a given number.

    Args:
        n: An integer.

    Returns:
        The next bigger number formed by rearranging the digits of n.
    """
    digits = sorted(list(str(n)))
    if digits:
        i = len(digits) - 2
        while i >= 0 and digits[i] >= digits[i + 1]:
            i -= 1
        if i == -1:
            digits.pop()
            return int("".join(digits))
        else:
            digits[i] = digits[i + 1]
            digits.pop(i + 1)
            return int("".join(digits))
    else:
        return 0
