def no_of_subsequences(arr, k):
    n = len(arr)
    count = 0
    for i in range(1 << n):
        product = 1
        subsequence = []
        for j in range(n):
            if (i >> j) & 1:
                product *= arr[j]
                subsequence.append(arr[j])
        if product < k:
            count += 1
    return count
```

